```{.r .cell-code}
  fraud %>% filter((distance_miles > 50) &
                     (correct_state == TRUE)) %>% 
    distinct(city,
           state, 
  city.y,
    hamlet,
    suburb,
    neighbourhood,
    village,
    town,
    county,
    state.y,
    country
    ) %>%
    gt() %>%
